import React from 'react';

class Order extends React.Component {

  // fishes = {this.props.fishes;
  render() {
    return (
      <ul className="list-items">
        {Object.keys(this.props.orders).map((key) => {
          <li>
            <p>{this.props.fishes[key].name}</p>
          </li>

        })}
      </ul>
    );
  }
};

export default Order;
